package com.chen.dao.main;

public class User {
	private String u_id;
	private String u_username;
	private String u_name;
	private String u_password;
	private String u_phone;
	private String u_email;
	private String u_city;
	private String u_gender;
	private String u_image;
	private String u_registeredtime;
	private String u_birthday;
	public User() {
		super();
		// TODO Auto-generated constructor stub
	}
	public User(String u_id, String u_username, String u_name, String u_password, String u_phone, String u_email,
			String u_city, String u_gender, String u_image, String u_registeredtime, String u_birthday) {
		super();
		this.u_id = u_id;
		this.u_username = u_username;
		this.u_name = u_name;
		this.u_password = u_password;
		this.u_phone = u_phone;
		this.u_email = u_email;
		this.u_city = u_city;
		this.u_gender = u_gender;
		this.u_image = u_image;
		this.u_registeredtime = u_registeredtime;
		this.u_birthday = u_birthday;
	}
	public String getU_id() {
		return u_id;
	}
	public void setU_id(String u_id) {
		this.u_id = u_id;
	}
	public String getU_username() {
		return u_username;
	}
	public void setU_username(String u_username) {
		this.u_username = u_username;
	}
	public String getU_name() {
		return u_name;
	}
	public void setU_name(String u_name) {
		this.u_name = u_name;
	}
	public String getU_password() {
		return u_password;
	}
	public void setU_password(String u_password) {
		this.u_password = u_password;
	}
	public String getU_phone() {
		return u_phone;
	}
	public void setU_phone(String u_phone) {
		this.u_phone = u_phone;
	}
	public String getU_email() {
		return u_email;
	}
	public void setU_email(String u_email) {
		this.u_email = u_email;
	}
	public String getU_city() {
		return u_city;
	}
	public void setU_city(String u_city) {
		this.u_city = u_city;
	}
	public String getU_gender() {
		return u_gender;
	}
	public void setU_gender(String u_gender) {
		this.u_gender = u_gender;
	}
	public String getU_image() {
		return u_image;
	}
	public void setU_image(String u_image) {
		this.u_image = u_image;
	}
	public String getU_registeredtime() {
		return u_registeredtime;
	}
	public void setU_registeredtime(String u_registeredtime) {
		this.u_registeredtime = u_registeredtime;
	}
	public String getU_birthday() {
		return u_birthday;
	}
	public void setU_birthday(String u_birthday) {
		this.u_birthday = u_birthday;
	}
	
	
}
